  return request({
    method: 'put',
    url: '/api/v1/mobileEduPerson/read/queryClassStuByStu',
    data,
  });
}
/**
 * 查询学生同班同学
 * @param {} data
 */
export function getOrgUser(data) {
  return request({
    method: 'put',
    url: '/api/orgMobile/read/getOrgUser',
    data,
  });
}
